};


const deleteArchivo = async (req, res) => {
	try{
		const {idArc} = req.params;
		const connection = await getConnection();
		const result = await connection.query("DELETE FROM Archivos WHERE idArc = ?", idArc);
		res.json(result);


	}catch (error){
